  false,\n\t\"url\": null,\n\t\"notes\": \"This unemployment rate data comes from
  the Bureau of Labot Statistics Local Area Unemployment Statistics (LAUS), which
  are published on a monthly basis.  It is not seasonally adjusted. It includes data
  for the following counties: Orleans Parish, LA (New Orleans); Oklahoma County, OK
  (Oklahoma City); Hillsborough County, FL (Tampa); Wake County, NC (Raleigh); Fulton
  County, GA (Atlanta); Miami-Dade County, FL (Miami); Davidson County, TN (Nashville);
  Shelby County, TN (Memphis); Jefferson County, KY (Louisiville). This data covers
  the time period of 2005 to present.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
